We try not to use out parameters in the codebase. And for this case we should instead turn this into test set up in a test fixture anyway:

class ServerSocketTest : public ::testing::Test
{
protected:
  virtual void SetUp()
  {
    ASSERT_SOME(socket.bind(node));
    node = bind.get();
    ASSERT_SOME(socket.listen(5));
  }

  Node node;
  Socket socket;
};


Then the 'connect' test below can just be:

TEST_F(ServerSocketTest, connect)
{
  Socket clientSocket;
  AWAIT_EXPECT_READY(clientSocket.connect(node));
}


Also, using 'node' as the default bind is weird, we should really have a Node::LOCALHOST constant that we can use instead!

Although honestly for both the 'connect' and 'connectFail' tests we could just do this inline, it's not that much code:

TEST(Socket, connect)
{
  Socket serverSocket;

  Try<Node> bind = serverSocket.bind(Node::LOCALHOST);
  ASSERT_SOME(bind);

  ASSERT_SOME(serverSocket.listen(5));

  Socket clientSocket;
  AWAIT_EXPECT_READY(clientSocket.connect(bind.get()));
}

