The test tends to get pretty long due to these constructions. Utimately it looks like we are just constructing two `Resources` `r1` and `r2` and testing their `diff`. How about simply:

```
Resource disk = createDiskResource("8192", "role1", "1", "path", None(), true);

Resource r1 = Resources::parse("cpus:40;mem:4096").get() + disk + disk;
Resource r2 = Resources::parse("cpus:5;mem:512").get() + disk;

Resources diff1 = r1 - r2;
```

Note that we are focusing on subtraction here.

I'd recommend more informative test. First, create List<String> expected = Arrays.asList("a", "b", "c");

then for each test case do just this:

assertEquals(expected, Arrays.asList(PathUtils.strip...());

this automatically checks the size, but it also checks exact equality of two values, while the existing tests will miss something like ["a", "b", "c"] vs [ "", "a", "b"].

The above style also allows you to define upfront all possible paths as an array of strings, and then do all assertions inside the loop. More compact and easy to add new test cases.

