I don't think we need to special case this. Consider the alert definitions for HDFS and YARN:

{code:title=HDFS}
            "high_availability": {
              "nameservice": "{{hdfs-site/dfs.internal.nameservices}}",
              "alias_key" : "{{hdfs-site/dfs.ha.namenodes.{{ha-nameservice}}}}",
              "http_pattern" : "{{hdfs-site/dfs.namenode.http-address.{{ha-nameservice}}.{{alias}}}}",
              "https_pattern" : "{{hdfs-site/dfs.namenode.https-address.{{ha-nameservice}}.{{alias}}}}"
            }
{code}

{code:title=YARN}
            "high_availability": {
              "alias_key" : "{{yarn-site/yarn.resourcemanager.ha.rm-ids}}",
              "http_pattern" : "{{yarn-site/yarn.resourcemanager.webapp.address.{{alias}}}}",
              "https_pattern" : "{{yarn-site/yarn.resourcemanager.webapp.https.address.{{alias}}}}"
            }
{code}

HDFS has a {{nameservice}} key as part of the URI and YARN does not. That's the way we can tell what to do:

- If {{nameservice}} is defined as a key on the definition _and_ it exists in the configuration ({{hdfs-site}} for example) then {{alias_key}} must resolve
- If {{nameservice}} is *NOT* defined on the definition, then only use HA if {{alias_key}} resolves.

